import java.util.Arrays;
import java.util.Collections;
import java.util.HashSet;
import java.util.Set;

class MinDeletionsForUniqueFrequency {
    public static void main(String[] args) {
        System.out.println(minDeletions("abcabc"));
        System.out.println(minDeletions("abbcccdddeeeefffffggggghhhhh")); //12334555 //55543321 //9

        System.out.println(minDeletions("aaaaaassssddddfffggh"));
        System.out.println(minDeletions(""));

    }

    public static int minDeletions(String s) {

        Integer[] initialFrequencies = Collections.nCopies(26, 0).toArray(new Integer[0]);
        for (char c : s.toCharArray()) {
            initialFrequencies[c - 'a'] = initialFrequencies[c - 'a'] + 1;
        }

        Arrays.sort(initialFrequencies, (o1, o2) -> o2 - o1);

        int resultSimple = 0;

//        int j = initialFrequencies[0];
//        for (int k = 1; k < initialFrequencies.length && k != 0; k++) {
//            Integer i = initialFrequencies[k];
//            j = j - 1;
//            if (j < 0) {
//                resultSimple = resultSimple + i;
//            } else {
//                for (; ; j--) {
//                    if (i.equals(j) || i > j) {
//                        if (i > j) {
//                            resultSimple = resultSimple + (i - j);
//                        }
//                        break;
//                    }
//                }
//            }
//        }

        Set set = new HashSet<Integer>();
       // outerloop:
        for (int i : initialFrequencies) { //12334555 //55543321 //54321000 0+1+2+2+2+6
            while (set.contains(i)) {
                if (i == 0) {
                    break;
                }
                i--;
                resultSimple++;

            }
            set.add(i);
        }
        return resultSimple;
    }

    static int sumOfFirstNNumbers(int n) {
        if (n == 0)
            return 0;
        if (n == 1)
            return 1;
        return n + sumOfFirstNNumbers(n - 1);
    }
}
